Diskussioun:Lëscht vun de kathoulesche Peepst [änneren] dt. oder fr.? Lëtzebuergesch kënne mer se jo net gudd deefen, z.B. Clemy I. oder Muerzel I oder Benny XVI.. Also musse mer eis eng afale loossen. Fir eis franséisch oder däitsch Noperen nët ze frustréieren proposéieren ech d'Sprooch vun der Kathoulescher Kierch: Latäin. Wat mengt de Comité?? -- Carlos 16:40, 2 November 2005 (UTC) Du hues ganz Recht. Et ass op alle Fall beseer wéi déi däitsch Eeërdänz. --Cornischong 16:50, 2 November 2005 (U
